import React from "react";
import {Link} from 'react-router-dom';

const Button = () => {
  const openIOH = (e) => {
    e.preventDefault();
    window.location.href('https://in-our-hands.com/');
  }

  return(
    <Link to="/in-our-hands">
    <button onClick={openIOH}> In Our Hands</button>
   </Link>
  )
}

export {Button as default};
